<script>
////////////////////////////////////////////////////////////////////////////////
// Make this example work without importing it as a module!
// Originally from https://github.com/chartjs/Chart.js/blob/master/docs/scripts/utils.js

// If this were an inline module, what could we do?
//import kurkleColor from 'https://cdn.skypack.dev/@kurkle/color';
// Actually, kurkle/color doesn't even export colorLib!
// Based on usage, it means the same as color().

var valueOrDefault = Chart.helpers.valueOrDefault;
var colorLib = Chart.helpers.color;
////////////////////////////////////////////////////////////////////////////////

//import colorLib from '@kurkle/color';
//import {DateTime} from 'luxon';
//import 'chartjs-adapter-luxon';
//import {valueOrDefault} from '../../dist/helpers.esm';

// Adapted from http://indiegamr.com/generate-repeatable-random-numbers-in-js/
var _seed = Date.now();

function Utils_srand(seed) {
  _seed = seed;
}

function Utils_rand(min, max) {
  min = valueOrDefault(min, 0);
  max = valueOrDefault(max, 0);
  _seed = (_seed * 9301 + 49297) % 233280;
  return min + (_seed / 233280) * (max - min);
}

function Utils_numbers(config) {
  var cfg = config || {};
  var min = valueOrDefault(cfg.min, 0);
  var max = valueOrDefault(cfg.max, 100);
  var from = valueOrDefault(cfg.from, []);
  var count = valueOrDefault(cfg.count, 8);
  var decimals = valueOrDefault(cfg.decimals, 8);
  var continuity = valueOrDefault(cfg.continuity, 1);
  var dfactor = Math.pow(10, decimals) || 0;
  var data = [];
  var i, value;

  for (i = 0; i < count; ++i) {
    value = (from[i] || 0) + Utils_rand(min, max);
    if (Utils_rand() <= continuity) {
      data.push(Math.round(dfactor * value) / dfactor);
    } else {
      data.push(null);
    }
  }

  return data;
}

function Utils_points(config) {
  const xs = Utils_numbers(config);
  const ys = Utils_numbers(config);
  return xs.map((x, i) => ({x, y: ys[i]}));
}

function Utils_bubbles(config) {
  return Utils_points(config).map(pt => {
    pt.r = Utils_rand(config.rmin, config.rmax);
    return pt;
  });
}

function Utils_labels(config) {
  var cfg = config || {};
  var min = cfg.min || 0;
  var max = cfg.max || 100;
  var count = cfg.count || 8;
  var step = (max - min) / count;
  var decimals = cfg.decimals || 8;
  var dfactor = Math.pow(10, decimals) || 0;
  var prefix = cfg.prefix || '';
  var values = [];
  var i;

  for (i = min; i < max; i += step) {
    values.push(prefix + Math.round(dfactor * i) / dfactor);
  }

  return values;
}

const MONTHS = [
  'January',
  'February',
  'March',
  'April',
  'May',
  'June',
  'July',
  'August',
  'September',
  'October',
  'November',
  'December'
];

function Utils_months(config) {
  var cfg = config || {};
  var count = cfg.count || 12;
  var section = cfg.section;
  var values = [];
  var i, value;

  for (i = 0; i < count; ++i) {
    value = MONTHS[Math.ceil(i) % 12];
    values.push(value.substring(0, section));
  }

  return values;
}

const COLORS = [
  '#4dc9f6',
  '#f67019',
  '#f53794',
  '#537bc4',
  '#acc236',
  '#166a8f',
  '#00a950',
  '#58595b',
  '#8549ba'
];

function Utils_color(index) {
  return COLORS[index % COLORS.length];
}

function Utils_transparentize(value, opacity) {
  var alpha = opacity === undefined ? 0.5 : 1 - opacity;
  return colorLib(value).alpha(alpha).rgbString();
}

const CHART_COLORS = {
  red: 'rgb(255, 99, 132)',
  orange: 'rgb(255, 159, 64)',
  yellow: 'rgb(255, 205, 86)',
  green: 'rgb(75, 192, 192)',
  blue: 'rgb(54, 162, 235)',
  purple: 'rgb(153, 102, 255)',
  grey: 'rgb(201, 203, 207)'
};

const NAMED_COLORS = [
  CHART_COLORS.red,
  CHART_COLORS.orange,
  CHART_COLORS.yellow,
  CHART_COLORS.green,
  CHART_COLORS.blue,
  CHART_COLORS.purple,
  CHART_COLORS.grey,
];

function Utils_namedColor(index) {
  return NAMED_COLORS[index % NAMED_COLORS.length];
}

}

  return luxon.DateTime.fromISO(str);

function rescaleDataSet(i,el) {
  if (!locked) {
    myChart.data.datasets[0].data = dataByTOW[i].map((p) => ({x:p.x, y:p.y}));
    myChart.update();
    
    let residuals = dataByTOW[i].map((p,i) => ({x:i, y:p.y-p.ypred}));
    myResidualsChart.data.datasets[0].data = residuals;
    myResidualsChart.update();
    
    // Determine if the i^th TOW is occupied.
    let n_weeks = residuals.length;
    let n_underpredict = residuals.filter((p) => p.y > 0).length;
    let fraction_under = n_underpredict / n_weeks;
    let is_occupied = (n_underpredict > 0.65 * n_weeks);
    
    document.getElementById("residualsStats").innerHTML=(
      `<table class="mytooltip">
      <tr><td >TOW:</td>             <td>${i}</td></tr>
      <tr><td>Num weeks:</td>       <td>${n_weeks}</td></tr>
      <tr><td># underpredicted:</td><td>${n_underpredict}</td></tr>
      <tr><td>% underpredicted:</td><td>${(100*fraction_under).toFixed(0)}%</td></tr>
      <tr><td>Is occupied:</td>     <td>${is_occupied}</td></tr>
      </table>`
    );
  }
  return false;
}

var locked = false;
var lockedElement = null;
function toggleLockTimeOfWeek(i,el) {
  if (locked) {
    lockedElement.classList.remove("locked");
    locked = false;
    rescaleDataSet(i,el);
  } else {
    lockedElement = el;
    lockedElement.classList.add("locked");
    locked = true;
  }
}

for (let i = 0; i < 168; i += 1) {
  let el=document.createElement("div");
  el.className='mymouseover';
  el.id = "tow" + i;
  el.innerText=i;
  el.onmouseover=() => rescaleDataSet(i,el);
  el.onclick=() => toggleLockTimeOfWeek(i,el);
  document.getElementById("mydiv").appendChild(el);
  if (i % 24 == 23) {
  document.getElementById("mydiv").appendChild(document.createElement("br"));
  }
  
  // Determine if the i^th TOW is occupied.
  let residuals = dataByTOW[i].map((p,i) => ({x:i, y:p.y-p.ypred}));
  let n_weeks = residuals.length;
  let n_underpredict = residuals.filter((p) => p.y > 0).length;
  let is_occupied = (n_underpredict > 0.65 * n_weeks);
  //console.log(i, n_weeks, n_underpredict, is_occupied);
  if (is_occupied) el.classList.add("occupied");
}
